import React from 'react';
import { ContactContainer, ContactListItem } from './contact.styles';
import GithubLogo from '../../assets/github-logo.png';
const ContactPage = () => (
  <ContactContainer>
    <h2>This work was made by</h2>
    <ul>
      <ContactListItem>
        safouman{' '}
        <img
          src={GithubLogo}
          alt="github"
          className="Logo"
          style={{ width: '100px' }}
        />
      </ContactListItem>
      <ContactListItem>safouman instagram</ContactListItem>
      <ContactListItem>safouman Medium</ContactListItem>
    </ul>
  </ContactContainer>
);

export default ContactPage;
